    /**
     * A manager which handles auto-start and auto-shutdown events for the Citation Longitude.
     */
    class LongitudeAutostartManager {
        /**
         * Creates a new instance of LongitudeAutostartManager. Once created, the manager will automatically execute
         * auto-start and auto-stop procedures in response to the corresponding key events.
         * @param bus The event bus.
         * @param bleedAir The bleed air system.
         */
        constructor(bus, bleedAir) {
            this.bus = bus;
            this.bleedAir = bleedAir;
            this.isStarting = false;
            this.isShuttingDown = false;
            msfssdk.KeyEventManager.getManager(bus).then(manager => {
                this.keyEventManager = manager;
                manager.interceptKey('ENGINE_AUTO_START', false);
                manager.interceptKey('ENGINE_AUTO_SHUTDOWN', false);
                this.bus.getSubscriber().on('key_intercept').handle(this.onKeyIntercepted.bind(this));
            });
        }
        /**
         * Responds to key intercept events.
         * @param data The event data.
         */
        onKeyIntercepted(data) {
            switch (data.key) {
                case 'ENGINE_AUTO_START':
                    this.performStart();
                    break;
                case 'ENGINE_AUTO_SHUTDOWN':
                    this.performShutdown();
                    break;
            }
        }
        /**
         * Performs the start procedure.
         */
        async performStart() {
            if (this.isStarting) {
                return;
            }
            this.isShuttingDown = false;
            this.isStarting = true;
            await Promise.all([
                // Turn on batteries
                SimVar.SetSimVarValue('B:ELECTRICAL_Battery_1_On', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:ELECTRICAL_Battery_2_On', msfssdk.SimVarValueType.Number, 0),
                // Turn on standby instrument
                this.keyEventManager.triggerKey('MASTER_BATTERY_ON', false, 3),
                // Turn on generators
                SimVar.SetSimVarValue('B:ELECTRICAL_Alternator_1_On', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:ELECTRICAL_Alternator_2_On', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:ELECTRICAL_APU_Generator_1', msfssdk.SimVarValueType.Number, 0),
            ]);
            if (!this.isStarting) {
                return;
            }
            let isLeftEngineRunning = this.isEngineRunning(1);
            let isRightEngineRunning = this.isEngineRunning(2);
            if (isLeftEngineRunning && isRightEngineRunning) {
                this.isStarting = false;
                return;
            }
            await Promise.all([
                // Start APU
                this.keyEventManager.triggerKey('APU_STARTER', false),
                // Set all bleed air switches to NORM
                SimVar.SetSimVarValue('B:LNG_PNEUMATICS_Engine_Bleed_L_Norm', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:LNG_PNEUMATICS_Engine_Bleed_R_Norm', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:LNG_PNEUMATICS_APU_Bleed_Norm', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:LNG_PNEUMATICS_Bleed_Isolate_Norm', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:LNG_PNEUMATICS_Left_Press_Source_Norm', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:LNG_PNEUMATICS_Right_Press_Source_Norm', msfssdk.SimVarValueType.Number, 0),
            ]);
            isLeftEngineRunning = this.isEngineRunning(1);
            isRightEngineRunning = this.isEngineRunning(2);
            if (isLeftEngineRunning && isRightEngineRunning) {
                this.isStarting = false;
                return;
            }
            let enginePsiWait = 60000;
            if (!isRightEngineRunning) {
                // Wait for right engine bleed air to reach 32psi.
                try {
                    await msfssdk.Wait.awaitSubscribable(this.bleedAir.getLine(BleedLine.RightEngineBack).currentPsi, psi => psi >= 32, true, 15000 + enginePsiWait);
                    enginePsiWait = 0;
                }
                catch (_a) {
                    return;
                }
                const rightEngineStarted = await this.startEngine(2);
                if (!rightEngineStarted || !this.isStarting) {
                    this.isStarting = false;
                    return;
                }
            }
            if (!this.isEngineRunning(1)) {
                // Wait for left engine bleed air to reach 32psi.
                try {
                    await msfssdk.Wait.awaitSubscribable(this.bleedAir.getLine(BleedLine.LeftEngineBack).currentPsi, psi => psi >= 32, true, 15000 + enginePsiWait);
                }
                catch (_b) {
                    return;
                }
                const leftEngineStarted = await this.startEngine(1);
                if (!leftEngineStarted || !this.isStarting) {
                    this.isStarting = false;
                    return;
                }
            }
            // Shut off APU
            await this.keyEventManager.triggerKey('APU_OFF_SWITCH', false);
            this.isStarting = false;
        }
        /**
         * Attempts to start an engine.
         * @param index The index of the engine to start.
         * @returns A Promise which is fulfilled with whether the engine start was successful at the end of the operation.
         */
        async startEngine(index) {
            if (this.isEngineRunning(index)) {
                return true;
            }
            await Promise.all([
                SimVar.SetSimVarValue(`L:WT_Longitude_Engine_Run:${index}`, msfssdk.SimVarValueType.Number, 1),
                this.keyEventManager.triggerKey(`STARTER${index}_SET`, false, 1)
            ]);
            if (!this.isStarting) {
                return false;
            }
            try {
                await msfssdk.Wait.awaitConsumer(this.bus.getSubscriber().on(`n2_${index}`), n2 => n2 >= 58, true, 45000);
            }
            catch (_a) {
                return false;
            }
            if (!this.isStarting) {
                return false;
            }
            return this.isEngineRunning(index);
        }
        /**
         * Performs the shutdown procedure.
         */
        async performShutdown() {
            if (this.isShuttingDown) {
                return;
            }
            this.isStarting = false;
            this.isShuttingDown = true;
            await Promise.all([
                // Shut off engine starters and set engines to STOP
                this.keyEventManager.triggerKey('STARTER1_SET', false, 0),
                this.keyEventManager.triggerKey('STARTER2_SET', false, 0),
                SimVar.SetSimVarValue('L:WT_Longitude_Engine_Run:1', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('L:WT_Longitude_Engine_Run:2', msfssdk.SimVarValueType.Number, 0),
                // Shut off APU
                this.keyEventManager.triggerKey('APU_OFF_SWITCH', false),
                // Turn off external power
                SimVar.SetSimVarValue('B:ELECTRICAL_ExternalPower_1', msfssdk.SimVarValueType.Number, 0),
                // Shut off standby instrument
                this.keyEventManager.triggerKey('MASTER_BATTERY_OFF', false, 3),
                // Shut off batteries
                SimVar.SetSimVarValue('B:ELECTRICAL_Battery_1_Off', msfssdk.SimVarValueType.Number, 0),
                SimVar.SetSimVarValue('B:ELECTRICAL_Battery_2_Off', msfssdk.SimVarValueType.Number, 0),
            ]);
            this.isShuttingDown = false;
        }
        /**
         * Checks if an engine is running.
         * @param index The index of the engine to check.
         * @returns Whether the specified engine is running.
         */
        isEngineRunning(index) {
            return SimVar.GetSimVarValue(`L:WT_Longitude_Engine_Run:${index}`, msfssdk.SimVarValueType.Number) === 1
                && SimVar.GetSimVarValue(`TURB ENG CORRECTED N2:${index}`, msfssdk.SimVarValueType.Percent) >= 58;
        }
    }

    /**
     * The main MFD plugin for the Cessna Citation C700 Longitude.
     */
    class LongitudeMfdPlugin extends wtg3000mfd.AbstractG3000MfdPlugin {
        /** @inheritdoc */
        onInit() {
            this.bleedAirSystem = new LongitudeBleedAirSystem(this.binder.bus, true);
            this.bleedAirSystem.init();
            this.ecsSystem = new LongitudeEcsSystem(this.bleedAirSystem, this.binder.bus, true);
            this.fuelSystem = new LongitudeFuelSystem(this.binder.bus, true);
            this.hydraulicsSystem = new LongitudeHydraulicSystem(this.binder.bus, true);
            this.electricalSystem = new LongitudeElectricalSystem(this.binder.bus, this.ecsSystem, true);
            this.engineMonitor = new LongitudeEngineMonitor(this.binder.bus, this.electricalSystem, true);
            this.antiIceSystem = new LongitudeAntiIceSystem(this.binder.bus, this.bleedAirSystem, this.electricalSystem, true);
            this.eisDataProvider = new LongitudeEisDataProvider(this.binder.bus, this.binder.backplane, this.electricalSystem, this.fuelSystem);
            this.externalLightsSystem = new LongitudeExternalLightsSystem(this.binder.bus, this.electricalSystem, true);
            this.autoTestSystem = new LongitudeAutoTestSystem(this.binder.bus, this.fuelSystem, this.hydraulicsSystem, this.antiIceSystem, this.electricalSystem, true);
            this.pressurizationSystem = new LongitudePressurizationSystem(this.binder.bus, this.bleedAirSystem, this.electricalSystem, this.binder.flightPlanStore);
            this.autoStartManager = new LongitudeAutostartManager(this.binder.bus, this.bleedAirSystem);
            new OpPhaseStateInhibitor(this.binder.bus);
            new LongitudeCrewAlerter(this.binder.bus, this.electricalSystem, this.fuelSystem, this.hydraulicsSystem, this.bleedAirSystem, this.pressurizationSystem, this.antiIceSystem);
            this.binder.backplane.addPublisher('stallWarning', new msfssdk.StallWarningPublisher(this.binder.bus, 0.8));
            this.binder.bus.getSubscriber().on('stall_warning_on')
                .handle(w => SimVar.SetSimVarValue('L:WT_LNG_STALL_WARNING', msfssdk.SimVarValueType.Number, w ? 1 : 0));
        }
        /** @inheritdoc */
        renderEis() {
            return (msfssdk.FSComponent.buildComponent(LongitudeEngineInstruments, { dataProvider: this.eisDataProvider, antiIce: this.antiIceSystem, bleedAir: this.bleedAirSystem, pressurization: this.pressurizationSystem, settings: LongitudeUserSettings.getManager(this.binder.bus) }));
        }
        /** @inheritdoc */
        registerDisplayPaneViews(viewFactory) {
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.EcsSynoptics, (index) => msfssdk.FSComponent.buildComponent(EcsSynopticsPane, { halfSizeOnly: true, index: index, bleedAir: this.bleedAirSystem, ecs: this.ecsSystem, bus: this.binder.bus }));
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.FuelSynoptics, (index) => msfssdk.FSComponent.buildComponent(FuelSynopticsPane, { halfSizeOnly: true, index: index, bus: this.binder.bus, fuelSystem: this.fuelSystem }));
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.HydraulicsSynoptics, (index) => msfssdk.FSComponent.buildComponent(HydraulicsSynopticsPane, { halfSizeOnly: true, index: index, bus: this.binder.bus, hydraulicSystem: this.hydraulicsSystem }));
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.SummarySynoptics, (index) => msfssdk.FSComponent.buildComponent(SummarySynopticsPane, { halfSizeOnly: true, index: index, bus: this.binder.bus, hydraulics: this.hydraulicsSystem, ecs: this.ecsSystem, electrical: this.electricalSystem, lights: this.externalLightsSystem }));
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.FlightControlsSynoptics, (index) => msfssdk.FSComponent.buildComponent(FlightControlsSynopticsPane, { halfSizeOnly: true, index: index, bus: this.binder.bus, hydraulics: this.hydraulicsSystem }));
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.ElectricalSynoptics, (index) => msfssdk.FSComponent.buildComponent(ElectricalSynopticsPane, { halfSizeOnly: true, index: index, electrical: this.electricalSystem }));
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.AntiIceSynoptics, (index) => msfssdk.FSComponent.buildComponent(AntiIceSynopticsPane, { halfSizeOnly: true, index: index, bleedAir: this.bleedAirSystem, antiIce: this.antiIceSystem }));
            viewFactory.registerView(LongitudeDisplayPaneViewKeys.PreFlightSynoptics, (index) => msfssdk.FSComponent.buildComponent(PreFlightSynopticsPane, { halfSizeOnly: true, index: index, testSystem: this.autoTestSystem, electrical: this.electricalSystem, engineMonitor: this.engineMonitor, bus: this.binder.bus }));
        }
    }
    msfssdk.registerPlugin(LongitudeMfdPlugin);

